英語名：Electronic Accessories Cable USB Drive Organizer Bag Portable Travel Insert Case


<br><br>
大型のケーブル収納バッグで、USBフラッシュメモリ、ハードドライブ、タブレット、スマホ、メモリーカード、イヤホンなどの小物を固定し収納できます。
軽量なので持ち運びに最適です。旅行にも便利。<br>
2つのファスナーポケット付きで細かいものも収納できます。<br><br>

材質：ナイロン<br>
サイズ：約 22.6cm x 15.7cm<br>
重量：70g<br>
パッケージ：
1個xバッグ（電子付属品は含まれません）</DIV>
